import { useState, React, useEffect } from 'react';
export default function HealthDate({ data }) {
  const { moyenne, nbFab3Mois } = data;
  console.log(moyenne);
  const optionTabs = ['Statistiques', 'Top 10 magasins', 'Moyenne de produit'];
  const [currentTab, setCurrentTab] = useState('Statistiques');
  const handleTabClick = (tabName) => {
    setCurrentTab(tabName);
  };
  return (
    <>
      <div className="tabs">
        {optionTabs.map((item) => (
          <div className="tab">
            <div
              key={item}
              onClick={() => handleTabClick(item)}
              className={currentTab.current === item ? 'active' : ''}
            >
              {item}
            </div>
          </div>
        ))}
      </div>
      {currentTab === optionTabs[0] ? (
        <>
          <h3>Moyenne</h3>
          <div className="box-container">
            <div className="small-box">
              <h1>Moyenne de produits par fabricants</h1>
            </div>
          </div>
        </>
      ) : currentTab === optionTabs[1] ? (
        <div>
          <div class="box-container">
            <h1>hello</h1>
          </div>
        </div>
      ) : (
        ''
      )}
    </>
  );
}
